INSERT INTO `questions` (`id`, `question`, `A`, `B`, `C`, `D`, `ans`, `category`) VALUES
(1, 'A train running at the speed of 60 km/hr crosses a pole in 9 seconds. What is the length of the train?', '120 m', '180 m', '324 m', '150 m', '150 m', 1),
(2, '	\r\nA train 125 m long passes a man, running at 5 km/hr in the same direction in which the train is going, in 10 seconds. The speed of the train is:', '45 km/hr', '50 km/hr', '54 km/hr', '55 km/hr', '50 km/hr', 1),
(3, 'The length of the bridge, which a train 130 metres long and travelling at 45 km/hr can cross in 30 seconds, is:', '200m', '225m', '245m', '250m', '245m', 1),
(4, 'Two trains running in opposite directions cross a man standing on the platform in 27 seconds and 17 seconds respectively and they cross each other in 23 seconds. The ratio of their speeds is:', '1 : 3', '3 : 2', '3 : 4', 'None of th', '3 : 2', 1),
(5, 'From 7:00 AM to 11:00 AM it rained 2.25 inches. At 11:00 AM the rain increased to fall at a rate of 1.25 in. every two hours. How many inches of rain landed on the ground by 5:00 PM?', '7', '9.75', '6', '3.25', '6', 1),
(6, ' The owner of a hobby store needed to calculate the percentage of customers who purchase wood glue. Upon completing his survey, he noticed that 60% of the people that entered his store purchased an item. Of those customers, 15 percent purchased wood glue. What percent of the people that entered the store purchased wood glue?', '8', '7', '9', '12', '9', 1),
(7, 'If 1/x = 3.5 then 1/(x+2) =', '7/9', '16/7', '7/16', '9/7', '7/16', 1),
(8, ' A store owner is packing small radios into larger boxes that measure 25 in. by 42 in. by 60 in. If the measurement of each radio is 7 in. by 6 in. by 5 in., then how many radios can be placed in the box?', '300', '325', '400', '420', '300', 1),
(9, 'Frank is 15 years younger than John. In 5 years John will be twice as old as Frank. How old will Frank be in four years ', '8', '10', '12', '14', '14', 1),
(10, ' A store owner decided to raise the price of a particular item by exactly 10%. Of the following which is NOT the new price?', '1.10 Rs', '8.80 Rs', '11.00 Rs', '57.30 Rs', '57.30 Rs', 1),
(13, 'In a certain department store, which has four sizes of a specific shirt, there are 1/3 as many small shirts as medium shirts, and 1/2 as many large shirts as small shirts. If there are as many x-large shirts as large shirts, what percent of the shirts in the store are medium?', '10%', '25%', '60%', '33%', '60%', 1),
(14, '	A new apartment complex purchased 60 toilets and 20 shower heads. If the price of a toilet is three times the price of a shower head, what percent of the total cost was the cost of all the shower heads?', '9%', '10%', '11%', '12%', '10%', 1);
